CREATE SCHEMA `is_test` ;

DROP TABLE `is_test`.`user`;

CREATE TABLE `is_test`.`user` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `Name` varchar(255) default NULL,
  `Phone` varchar(100) default NULL,
  `Company` varchar(255),
  `IBAN` varchar(34),
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

